import "./button.css";
import ButtonItem from "./button_item";

const buttons = [
  ["AC", "+/-", "%", "/"],
  ["7", "8", "9", "*"],
  ["4", "5", "6", "-"],
  ["1", "2", "3", "+"],
  ["0", ".", "="],
];

const Button = () => {
  return (
    <div className="button-container">
      {buttons.map((row, rowIndex) => (
        <div className="button-row" key={rowIndex}>
          {row.map((btn) => (
            <ButtonItem btn={btn} key={btn} />
          ))}
        </div>
      ))}
    </div>
  );
};

export default Button;
